      out.write("	function calculateTotal(){\r\n");
      out.write("		var total=0;		\r\n");
      out.write("		var t=screenObjects.getScreenObject(\"investigationgrid_data\");\r\n");
      out.write("		var t1=screenObjects.getScreenObject(\"professionalgrid_data\");\r\n");
      out.write("		var rent=toNumber(screenObjects.getScreenObject(\"rentamount\").getValue());\r\n");
      out.write("		var doctorFee=toNumber(screenObjects.getScreenObject(\"doctorfees\").getValue());\r\n");
      out.write("		var opinionFee=toNumber(screenObjects.getScreenObject(\"opinionfees\").getValue());\r\n");
      out.write("		var totalPharmacy=toNumber(screenObjects.getScreenObject(\"totalpharmacy\").getValue());\r\n");
      out.write("		var cols=t.getCols();\r\n");
      out.write("		var s=t.getSize();\r\n");
      out.write("		for(var i=0;i<s;i++){\r\n");
      out.write("			total+=toNumber(t.getText(i,cols.amount));\r\n");
      out.write("		}\r\n");
      out.write("		cols=t1.getCols();\r\n");
      out.write("		s=t1.getSize();\r\n");
      out.write("		for(var i=0;i<s;i++){\r\n");
      out.write("			total+=toNumber(t1.getText(i,cols.doctoramount));\r\n");
      out.write("		}\r\n");
      out.write("		total=total+rent+doctorFee+opinionFee+totalPharmacy;\r\n");
      out.write("		screenObjects.getScreenObject(\"claimamount\").setValue(roundOff(total,2));\r\n");
      out.write("	}\r\n");
